import React, { Component } from "react";
import Radar from "react-d3-radar";
import Plot from "react-plotly.js";

class DOA extends Component {
  render() {
    return (
      <Plot
        data={[
          {
            x: [1, 2, 3],
            y: [2, 6, 3],
            type: "scatter",
            mode: "lines+points",
            marker: { color: "red" }
          },
          { type: "polar", x: [1, 2, 3], y: [2, 5, 3] }
        ]}
        layout={{ width: 320, height: 240, title: "A Fancy Plot" }}
      />
    );
  }
}

export default DOA;
